INSERT INTO `clinic_records` VALUES (4567106,2122052,'Prurito','Empezó hace 6 meses Apoquel más o menos comida hipoalergenica se termino pero  al mismo tiempo. Sin diferencia. Sin pastillas peor. Solo le falta una vacuna. No vomitos ni diarreas. Mañana y noche sin diferencia. Shampoo para heridas. Baño pasando 1 mes. Si los demás muy bn. Comiendo procan. Solía comer complete. Departamento cemento nunca le hizo daño. Hace 6 mese vive en césped. Se inflamó toda hospitalizada. Granitos poco en pecho y barriga. Se rascaba. Ahorita se rasca 7/8 con apoquel 2. Gases si son mal olientes.','','2020-04-21 17:26:04',NULL,'consultation',5597,'Ojeras',NULL,NULL,NULL,NULL,NULL,NULL,5597,NULL,1165,1170,'2020-04-21 17:53:37','2023-06-07 16:32:26',NULL,3677644,55515),(4567107,2122058,'CONSULTA dermatología','Paciente presenta prurito de 6/10 premanece en casa sin Baños come dogchow pero cambia a nutrapro. Lesiones no se sabe desde cuando. Ojitos con lesiones','Placas ERITEMA AXILAR, ERITEMA interdigital','2020-04-24 22:45:36',NULL,'consultation',5597,'',NULL,NULL,NULL,NULL,NULL,NULL,5597,NULL,1165,1170,'2020-04-27 22:51:09','2020-04-27 22:51:09',NULL,3693379,55515),(4567108,2122113,'Alergia','Último celo en febrero cuando llego con alergia. Con loratadina le iba bn. Se bañas 2 veces al mes con pets shampoo. Se alimenta con propac de cordero y arroz, con arroz sin sal. Le dan hueso de carnaza de un poco. Cepilla cada 4 veces por semana. Pasea solo come al día agua normal juega. Duerme en la sala en el mueble de tela. Ropa solo la noche x 8 días. Limpia con alcohol las patas. Se rasca todo el cuerpo. Ningún producto anti pulgas. No bonitos ni diarreas. No perfumes. Se rasca 5/10. No tos ni estornudar. Ninguna enfermedad. Se le cae mucho el pelo. Empezó hace 1 año y medio.','','2020-05-11 15:03:08',NULL,'consultation',5597,'',NULL,NULL,NULL,NULL,NULL,NULL,5597,NULL,1165,1170,'2020-05-11 15:58:01','2023-06-07 16:32:26',NULL,3729016,55515),(4567109,2122121,'Rasca orejas','Come balance, 