iona si no no. Baño cada día con clorhexidina de Toto pet 1 vez por semana. Come balanceado y se rasca fuego Barf de pollo y rascaba. Papá y pescado y le hizo pedazos y ahora ternero con papá. Sin gases. No tos no lagañas y es baboso. Tiene un componente de ansiedad.','','2023-01-31 21:07:14',NULL,'consultation',5597,'',NULL,NULL,NULL,NULL,NULL,NULL,5597,NULL,1165,1170,'2023-01-31 21:14:51','2023-06-07 16:32:39',NULL,9482920,55515),(4567750,2122767,'Terapia alergeno','Le han dado 3 dias Apoquel y la anterior semana un poquitito más.0,76 ml hongos. Sin ninguna reacción','','2023-02-01 19:57:45',NULL,'consultation',5597,'',NULL,NULL,NULL,NULL,NULL,NULL,5597,NULL,1165,1170,'2023-02-01 20:01:45','2023-02-01 20:37:21',NULL,9488368,55515),(4567751,2123288,'Piel','Pulgas. Tuvo varios picados.','','2023-02-01 22:19:26',NULL,'consultation',5597,'',NULL,NULL,NULL,NULL,NULL,NULL,5597,NULL,1165,1170,'2023-02-01 22:19:53','2023-06-07 16:32:39',NULL,9489510,55515),(4567752,2123291,'Piel','Los primeros meses. A los 6 meses empezó a rascarse. \r\nHa sido de mal comer. Siempre hay q ponerle algo.\r\nLe empezaron 14 días de Apoquel y luego volvió. Nunca llego a rascarse. Sobretodo las patas se lame. 2 meses vieron dermatólogo le recomiendo qué hay q hacer más tratamiento con Apoquel 28 días se calmó y dejó de tomar y vuelve. Le recomiendo bajar el pelito. El fin de semana ha calmado. Se ha bajado un tres la medicación. No le den pollo ni pan y carne de borrego. Pero siempre come. Sigue lamiéndose. Come canimentos con un poco de proteína del día. Sobre de comida azul. Gases eruptos no. Duerme en la casa. 90 por ciento dentro de casa duerme en cuarto. \r\nEstornudos no lagañas un poco. Siempre fue muy lagañoso.','','2023-02-01 23:09:43',NULL,'consultation',5597,'',NULL,NULL,NULL,NULL,NULL,NULL,5597,NULL,1165,1170,'2023-02-01 23:18:06','2023-06-07 16:32:39',NULL,9489927,55515),(4567753,2123281,'Afectación de la piel enfermedad inmunomediada','Paciente ha presentado hace algun tiempo lesiones en la piel. No conocen desde hace cuanto, ya tiene diagnostico de una enfermedad inmunomediada. La paciente usa ropa para protegerse del sol y proteger las lesiones. Vive la mayor parte del tiempo al aire libre y tiene espacio verde. Le han dado prednisona de 20mg 1 tableta cada 12 horas esporadicamente y ven que los signos mejoran algo. En cuanto a su comportamiento no observan ningun cambio importante. Comentan que ya le realizaron un examen antes pero no recuerdan cual.','Paciente presenta placas costrosas, placas fistulosas eritematosas en las que se observa secrecion. En la cabeza se observa placas costrosas y eritema periocular. La paciente presenta zonas de hipotricosis y de alopecia.','2021-11-20 16:13:39',NULL,'consultation',5597,'Proteger del sol hasta que nazca nuevo pelo. Cualquier duda escribirme Control en 1 mes y 2 semanas',NULL,NULL,NULL,NULL,NULL,NULL,5597,NULL,1165,1170,'2023-02-02 02:45:57','2023-06-07 16:32:39',NULL,9490674,55515),(4567754,2123281,'Control','Ven que esta mucho mejor ya casi no le ponen ropa y le esta saliendo más pelo. Tambien comentan que la notan con mas hambre. Se le comenta que es por la medicacion y que debemos seguir disminuyendo la dosis siempre. Se recomienda proteger del sol y estar atentos a cualquier signo.','Se encuentra una mejoria del 70% existen ya pocas placas costrosas.','2022-01-22 16:46:33',NULL,'control',5597,'Control por mensajes cada mes y presencial en 2 meses.',NULL,NULL,NULL,NULL,NULL,NULL,5597,NULL,1165,1170,'2023-02-02 03:00:07','2023-02-02 03:00:51',NULL,9490694,55515),(4567755,2123281,'Control','Paciente la encuentran mucho mejor presenta menos hambre y ya no usa ropa. Comentan que la dejaran unos dias en hospedaje. Tambien comentan que se les dificulta traerla por lo que haremos control por mensajes.','La paciente no presenta lesiones en rostro y ha crecido el pelo en la misma zona por lo que ya no se aprecia eritema facial. No se observan lesiones activas en cuerpo y lo que se observa en placa