tableta de 16 de Apoquel. mejoro con antibiótico. Ahí empeoro pero por viaje no pudo darle los cuidados necesarios.  Le hablaron de cytopoint. Defeca solo en la escuela1 o 2 veces al día. Come bastante. hace dos meses desp. interno.',NULL,'2023-06-20 16:18:47',NULL,'consultation',5609,'Favor realizar coproparasitario seriado a paciente INTI',NULL,NULL,NULL,NULL,NULL,NULL,5609,3445458,1165,1170,'2023-06-20 17:31:25','2023-06-20 17:36:40',NULL,NULL,NULL),(5311746,2122927,'Ha estado bien hace una semana empezó a rascarse. No come su comida de pollo','Le han dado pollo y carne','Ha estado bn se administra cytopoint','2023-06-20 20:47:23',NULL,'consultation',5609,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5609,NULL,1165,1170,'2023-06-20 20:49:23','2023-06-20 20:49:23',NULL,NULL,NULL),(5316296,2381636,'Piel','Siempre ha sido sensible la piel. Las patas se fue en mayo y enero a la playa. Crema canearen y lubridem. Talco. Crema de urea. Y otra de vet. Shampoo talvez clorhexidina. Viven en mucho campo. Come viceras y de cena hígado pollo arroz y yema de huevo y golosinas de perritos y gente. No se despierta en las noches. Antipulgas en mayo.gases normal. Lagañas más de una vez al día. Cada 15 días baño. No más problemas de salud.','Problemas en las patas','2023-06-21 20:07:02',NULL,'consultation',5609,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5609,NULL,1165,1170,'2023-06-21 20:13:08','2023-06-21 20:13:08',NULL,NULL,NULL),(5361501,2123030,'Terapia alergeno','Se ha mantenido con ropa. Le baño y se pudo Perla. El Apoquel 1/4. La pancita se afectó pero ya está bn. Los spray y platsul y ha mejorado. Pastillas a todos en la casa. Se administra 0,8 mg polenes y se rasCa enseguida. Próximo mes antiparasitario',NULL,'2023-06-22 16:32:48',NULL,'consultation',5609,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5609,NULL,1165,1170,'2023-06-22 16:34:34','2023-06-22 16:51:31',NULL,NULL,NULL),(5362226,2389939,'Alergia','Se trata en cevet no se está rascándose mucho. Vomita con medicación. Alérgico a la penicilina. Vomita con prednisona. Le han tratado con antibiótico. Ahora nutrique pavo. Propac Cordero antes con el nutrique se rasca.',NULL,'2023-06-22 18:13:46',NULL,'consultation',5609,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5609,NULL,1165,1170,'2023-06-22 18:16:12','2023-06-22 18:16:12',NULL,NULL,NULL),(5370817,2122893,'Terapia','Ha estado tomando Apoquel todos los días. Se envía pasando un día. No hay lesiones de contacto pero si se rasca un poco. Se administra 0,9 ácaros. Si se inflama en sitio de aplicación si todo va bien en dos dosis más termina',NULL,'2023-06-24 14:15:05',NULL,'control',5609,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5609,NULL,1165,1170,'2023-06-24 14:16:51','2023-06-24 14:16:51',NULL,NULL,NULL),(5372235,2393231,'Consulta','Hace un mes y medio. Recomendado otro vet. Tuvo una camada. Sale dos veces por semana. Y se queda en la terraza. Hace un mes y medio le salió lesiones en la grupa. Clorhexidina y antiinflamatorio talvez. No le ve que se rasca. Se lame se le cae el pelo estuvo con tratamiento suplementacion. Guerpo con promix. Antes licuado de verduras y huesos congelado. Hace un año fue mamá. Deshidratado de pollo de cerdo. Lo del pelo siempre ha sido así.',NULL,'2023-06-24 16:33:09',NULL,'consultation',5609,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5609,NULL,1165,1170,'2023-06-24 16:38:31','2023-06-24 16:38:31',NULL,NULL,NULL),(5373309,2393708,'Rascaba','Se rascaba las piernas pero se rasca la pancita. Como espinillas. Tritohexidin cada 8 días pero le ve qu se rascarse las noches. Pepas con comida húmeda. Come dos veces. Tostada come. Simparica ya hace más de un mes. No más enfermedades. Iguala siempre y se acalora. Vivía con otra perry y bn',NULL,'2023-06-24 18:13:09',NULL,'consultation',5609,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5609,NULL,1165,1170,'2023-06-24 18:17:29','2023-06-24 18:17:29',NULL,NULL,NULL),(5379294,2122851,'Consulta','Ha estado con cytopoint. Son de latacunga. Ya estado con un perrito que tiene muchos problemas de piel. Tambn hay gatos. U puede ser pu